    return (
        <button
            onClick={onClick}
            className=" mx-2 py-2 px-4 bg-indigo-600 h-12 text-white bold font-medium rounded-md hover:bg-indigo-800 text-lg opacity-80"
        >
            {content ? content : 'button'}
        </button>
    );
};
